import React from "react";
import "./style.css"

function Nav() {
  return (
    <nav className="navbar">
   <img height="100" width="300" src="http://learning.theacademy.ac/wp-content/uploads/2017/10/tAhs-BW-340156-300x138.png" alt="TOEFL  I  SAT  I  College Consulting  I  Boston  "></img>
      <a className="navbar-brand" href="/">
        React Reading List
      </a>
    </nav>
  );
}

export default Nav;
